import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="bg-gray-800 p-4">
            <div className="container mx-auto flex justify-between items-center">
                <div className="text-white text-lg font-bold">
                    This N That Mix Up Shop
                </div>
                <div className="space-x-4">
                    <Link to="/" className="text-gray-300 hover:text-white">Home</Link>
                    <Link to="/apparel" className="text-gray-300 hover:text-white">Apparel</Link>
                    <Link to="/accessories" className="text-gray-300 hover:text-white">Accessories</Link>
                    <Link to="/figures" className="text-gray-300 hover:text-white">Figures</Link>
                    <Link to="/about-us" className="text-gray-300 hover:text-white">About Us</Link>
                    <Link to="/cart" className="text-gray-300 hover:text-white">Cart</Link>
                    <Link to="/checkout" className="text-gray-300 hover:text-white">Checkout</Link>
                    <Link to="/collections" className="text-gray-300 hover:text-white">Collections</Link>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
